  return (
    <div className={'container-fluid' + props.state}>
        <ArrowButton/>
        <WeatherHeadline/>
        <MaxMin/>
        <div className='row'>
            <div className='col-12 metricRow '>
                <MetricItem type= {0} />
                <MetricItem type= {1} />
            </div>
        </div>
          <ForecastRow/>
          <MetricRow types = {[2, 3]}/>
    </div>
  )
}
